import React, { useEffect, useState } from 'react';
import styled from 'styled-components';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import axios from 'axios';
import { faUser as regularUser, faHeart as regularHeart } from '@fortawesome/free-regular-svg-icons'; 
import { faHeart } from '@fortawesome/free-solid-svg-icons';
import { useNavigate } from 'react-router-dom';

function Section1() {
  const [popularProjects, setPopularProjects] = useState([]);
  const navigate = useNavigate();

  const fetchPopularProjects = async () => {
    try {
      const response = await axios.get('/data.json');
      const projectsWithLikes = response.data.map(project => ({
        ...project,
        liked: false,
        likesCount: project.likesCount || 0
      }));
      setPopularProjects(projectsWithLikes);
    } catch (error) {
      console.error('Error fetching popular projects:', error);
    }
  };

  useEffect(() => {
    fetchPopularProjects();
  }, []);

  const handleProjectClick = (project) => {
    const modifiedPk = project.pk.replace('#', '');
    navigate(`/ApplyPage/${modifiedPk}`);
  };

  const handleLikeClick = (projectIndex) => {
    setPopularProjects((prevProjects) => {
      const newProjects = [...prevProjects];
      const project = newProjects[projectIndex];
      project.liked = !project.liked;
      project.likesCount += project.liked ? 1 : -1;
      return newProjects;
    });
  };

  return (
    <SectionWrapper>
      <SectionTitle>인기 프로젝트</SectionTitle>
      <ProjectList>
        {popularProjects.slice(0, 3).map((project, index) => (
          <ProjectCard key={index} onClick={() => handleProjectClick(project)}>
            <ProjectOwner>
              <FontAwesomeIcon icon={regularUser} style={{ fontSize: '20px', lineHeight: '1.2', marginRight: '6px' }} />
              {project.creatorID}
            </ProjectOwner>
            <ProjectTitle>{project.title}</ProjectTitle>
            <ProjectInfo>
              <Tags>
                {project.tags.map((tag, tagIndex) => (
                  <Tag key={tagIndex}>{tag}</Tag>
                ))}
              </Tags>
              <Details>모집인원 | {project.recruitmentNum}명</Details>
              <Details>마감일 | {new Date(project.deadline).toLocaleDateString()}</Details>
            </ProjectInfo>
            <ProjectLikes onClick={() => handleLikeClick(index)}>
              <FontAwesomeIcon icon={project.liked ? faHeart : regularHeart} style={{ color: project.liked ? 'red' : 'black', marginRight: '4px' }} />
              {project.likesCount}
            </ProjectLikes>
          </ProjectCard>
        ))}
      </ProjectList>
    </SectionWrapper>
  );
}

// Styled Components
const SectionWrapper = styled.div`
  width: calc(100% / 2 + 100px);
  border: 2px solid #A0DAFB;
  border-radius: 30px 30px 1px 30px;
  box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);
  background-color: rgba(160, 218, 251, 0.5);
`;

const SectionTitle = styled.h2`
  font-size: 24px;
  margin-bottom: 20px;
`;

const ProjectList = styled.div`
  display: flex;
  justify-content: center;
  flex-wrap: wrap;
  gap: 20px;
`;

const ProjectCard = styled.div`
  position: relative;
  border: 2px solid #A0DAFB;
  border-radius: 30px 30px 1px 30px;
  padding: 15px;
  margin-bottom: 20px;
  width: calc(100% / 4);
  box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);
  background-color: white;
  cursor: pointer;

  &:hover {
    background-color: #A0DAFB;
  }

  @media (max-width: 1200px) {
    width: calc(33.33% - 20px);
  }

  @media (max-width: 768px) {
    width: calc(50% - 20px);
  }

  @media (max-width: 480px) {
    width: 100%;
  }
`;

const ProjectOwner = styled.div`
  font-weight: bold;
  color: #858585;
`;

const ProjectTitle = styled.h3`
  margin: 10px 0;
`;

const ProjectInfo = styled.div`
  margin-top: 10px;
`;

const Tags = styled.div`
  display: flex;
  flex-wrap: wrap;
  margin-bottom: 5px;
`;

const Tag = styled.span`
  background-color: #E0E0E0;
  border-radius: 15px;
  padding: 5px 10px;
  margin-right: 5px;
`;

const Details = styled.div`
  font-size: 14px;
  color: #666;
`;

const ProjectLikes = styled.div`
  border: 1px solid #ddd;
  padding: 5px 10px;
  border-radius: 15px;
  color: white;
  font-weight: bold;
  background-color: #C4C4C4;
  cursor: pointer; 
  position: absolute; /* 카드 내부에 위치 */
  bottom: 10px; /* 카드 하단에 위치 */
  right: 10px; /* 카드 오른쪽에 위치 */
  z-index: 10; /* 클릭 영역 확보를 위한 z-index */

  &:hover {
    background-color: #A0DAFB; 
  }
`;

export default Section1;
